import React from 'react';
import { Link } from 'react-router-dom'

function shopContents() {
    return (
        <div>
            <div className='shop-header'>
                <h2>Fruits</h2>
                <Link to='/' className='BackHome'>Home</Link>
                <h2>Carts</h2>
            </div>
        </div>
    )
}

export default shopContents;
